// import React, { useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

function App() {
  const now = new Date();
  const min = now;
  const max = new Date(now.getFullYear(), now.getMonth() + 6, now.getDate());
  return (
    <div className="App">
      <header className="App-header">
          <h1>
            Expert Flight Search
          </h1>
      </header>

      {/* <textarea>
        Hello there, this is some text in a text area
      </textarea> */}
      <form>
        <label>
          <input type="text" placeholder="Leaving from" name="source" />
        </label>
        <label>
          {/* Going to: */}
          <input type="text" placeholder="Going to" name="destination" />
        </label>

        <input type="submit" value="Search" />
        <label>


        <Datepicker
          controls={['calendar']}
          select="range"
          min={min}
          max={max}
        />  
        </label>

        <label>
        Outbound
          <Input type="text" placeholder="Please Select..." name = "outbound"/>
        </label>
    </form>

    </div>
  );
}


 export default App;
